{'id': 39428585, 'body': 'Cám ơn Quý khách đã có phản hồi cho Techcombank,

Thưa Quý khách, nhằm đảm bảo đồng nhất chất lượng dịch vụ ngân hàng điện tử và nâng cao trải nghiệm dành cho Khách hàng, TCB thực hiện nâng cấp ứng dụng Techcombank Mobile, do đó, từ ngày 05/10/2023, ứng dụng Techcombank Mobile phiên bản cũ dưới 2.0.15 sẽ không thể truy cập được. Quý khách vui lòng cập nhật phiên bản Techcombank Mobile mới nhất trên chợ ứng dụng để tiếp tục sử dụng dịch vụ.

Mọi hỗ trợ trong trường hợp cần thiết, Quý khách vui lòng liên hệ với chúng tôi qua hotline: 1800 588 822 hoặc chi nhánh Techcombank gần nhất. Techcombank thành thật xin lỗi quý khách về sự bất tiện này. Rất mong nhận được sự thông cảm và hỗ trợ từ Quý khách', 'modified': '2023-10-10T10:07:59Z'}

