{'id': 39777088, 'body': 'Với tài khoản thanh toán và dịch vụ Ngân hàng điện tử đăng ký theo phương thức eKYC, bạn có thể sử dụng các dịch vụ cơ bản của Techcombank như chuyển tiền, rút tiền mặt qua ứng dụng, chuyển tiền qua CMND, thanh toán hóa đơn, gửi tiết kiệm trực tuyến... 
Ngoài ra, một số tính năng như đầu tư, kết nối với công ty chứng khoán, hay thay đổi hạn mức chuyển khoản sẽ chưa thể sử dụng ngay.
Hạn mức giao dịch của bạn như sau:
- Hạn mức của thẻ là 40 triệu đồng/ tháng; 
- Hạn mức giao dịch của tài khoản thanh toán là 60 triệu đồng/ tháng', 'modified': '2023-10-27T11:53:23Z'}

