Mọi hỗ trợ trong trường hợp cần thiết, Quý khách vui lòng liên hệ với chúng tôi qua hotline: 1800 588 822 hoặc chi nhánh Techcombank gần nhất. Techcombank thành thật xin lỗi quý khách về sự bất tiện này. Rất mong nhận được sự thông cảm và hỗ trợ từ Quý khách', 'modified': '2023-10-09T04:17:08Z'}

